import { useRef } from "react";
import { Link,  NavLink , Outlet } from "react-router-dom";

const RootLayout = () => {
    
    //Toggle Menu
    let firstSpan = useRef();
    let secondSpan = useRef();
    let thirdSpan = useRef();
    let nav = useRef();
    let toggleMenu = () => {
        firstSpan.current.classList.toggle("top-span");
        secondSpan.current.classList.toggle("middle-span");
        thirdSpan.current.classList.toggle("bottom-span");

        nav.current.classList.toggle("toggle-nav")
    };
    //Change Header Style
    let header = useRef();
    window.onscroll = () => {
        if (window.scrollY >= 10) {
            header.current.classList.add("change-header-style");
            header.current.style.backgroundColor = "white";
            header.current.style.color = "black";
            firstSpan.current.style.backgroundColor = "black"
            secondSpan.current.style.backgroundColor = "black"
            thirdSpan.current.style.backgroundColor = "black"

        } else {
            header.current.classList.remove("change-header-style");
            header.current.style.removeProperty("background-color");
            header.current.style.removeProperty("color");
            firstSpan.current.style.removeProperty("background-color");
            secondSpan.current.style.removeProperty("background-color");
            thirdSpan.current.style.removeProperty("background-color");
        }
    }
    
    return ( 
        <div className="root-layout">
            <header ref={header}>
                <div className="container">
                    <Link to="#" className="logo"><h1>Foodie<span></span></h1></Link>
                    <nav>
                        <div className="toggle-menu" onClick={toggleMenu}>
                            <span ref={firstSpan}></span>
                            <span ref={secondSpan}></span>
                            <span ref={thirdSpan}></span>
                        </div>
                        <ul ref={nav}>
                            <li><NavLink to="/" className="active">Home</NavLink></li>
                            <li><NavLink to="/#about">About</NavLink></li>
                            <li><NavLink to="menu">Menu</NavLink></li>
                            <li><NavLink to="blog">Blog</NavLink></li>
                            <li><NavLink to="contact">Contact Us</NavLink></li>
                            <li><NavLink to="reservation" className="main-btn resrv-btn">Reservation</NavLink></li>
                        </ul>
                    </nav>
                </div>
            </header>
            <main>
                <Outlet />
            </main>
            <footer>
                <div className="container">
                    <div className="social-links">
                        <Link to="#" className="logo"><h2>Foodie<span></span></h2></Link>
                        <p>Financial experts support or help you to to find out which way you can raise your funds more.</p>
                        <ul>
                            <li><Link to="#"><i className="fa fa-facebook"></i></Link></li>
                            <li><Link to="#"><i className="fa fa-twitter"></i></Link></li>
                            <li><Link to="#"><i className="fa fa-instagram"></i></Link></li>
                            <li><Link to="#"><i className="fa fa-linkedin"></i></Link></li>
                        </ul>
                    </div>
                    <div className="opening-hours">
                        <h2 className="footer-head">Opening Hours</h2>
                        <p>Monday-Friday: 08:00-22:00</p>
                        <p>Tuesday 4PM: Till Mid Night</p>
                        <p>Saturday: 10:00-16:00</p>
                    </div>
                    <div className="contact-info">
                        <h2 className="footer-head">Contact Info</h2>
                        <p>+1 (062) 109-9222</p>
                        <p>Info@YourGmail24.com</p>
                        <p>153 Williamson Plaza,<br></br>Maggieberg, MT 09514</p>
                    </div>
                    <form action="">
                        <input type="email" placeholder="Your Email" />
                        <button type="submit">SUBSCRIBE</button>
                    </form>
                </div>
                <div className="delivery-footer">
                    <img src={require("../images/delivery-boy.png")} alt="Delivery Boy" />
                </div>
                <div className="copy-rights">
                    <p>Coded With &#9829; By <Link to="https://osamaeid1.github.io/Portfolio/">Osama Eid</Link></p>
                </div>
            </footer>
            <button className="back-top-" ref={back-top}>^</button>
        </div>
    );
}

export default RootLayout;
